import React, { Component } from 'react';
import './App.css';
import Joke from './components/Joke';

const App = () => {
  return (
    <div>
      <Joke question="Hello" punchLine="World"/>
      <Joke question="What up" punchLine="Yeye"/>
      <Joke question="How's it hanging" punchLine="Good"/>
    </div>
  );
}
export default App;
